import React, { useState } from "react";
import formApi from "../services/formApi";

export default function FormEditModal({ form, onClose, onSave }) {
  const [formData, setFormData] = useState({ ...form });
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  // Handle input changes
  const handleChange = e => {
    const { name, value } = e.target;
    setFormData(prev => ({ ...prev, [name]: value }));
  };

  // Handle form submission
  const handleSubmit = async e => {
    e.preventDefault();
    setLoading(true);
    setError(null);

    try {
      const { data } = await formApi.updateForm(`/${form.id}`, formData);
      onSave(data); // Update parent table
      window.location.reload(); // Refresh to show updated data
    } catch (err) {
      console.error(err);
      setError(err.response?.data?.error || "Failed to update form");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div style={modalOverlayStyle}>
      <div style={modalContentStyle}>
        <h3>Edit Form</h3>
        {error && <p style={{ color: "red" }}>{error}</p>}

        <form onSubmit={handleSubmit} style={{ display: "flex", flexDirection: "column", gap: "10px" }}>
          <input
            type="text"
            name="nationalID"
            placeholder="National ID"
            value={formData.nationalID}
            onChange={handleChange}
            required
          />
          <input
            type="text"
            name="phoneNumber"
            placeholder="Phone Number"
            value={formData.phoneNumber}
            onChange={handleChange}
            required
          />
          <input
            type="text"
            name="firstName"
            placeholder="First Name"
            value={formData.firstName}
            onChange={handleChange}
            required
          />
          <input
            type="text"
            name="fatherName"
            placeholder="Father Name"
            value={formData.fatherName}
            onChange={handleChange}
            required
          />
          <input
            type="text"
            name="grandFatherName"
            placeholder="Grandfather Name"
            value={formData.grandFatherName}
            onChange={handleChange}
            required
          />
          <input
            type="text"
            name="lastName"
            placeholder="Last Name"
            value={formData.lastName}
            onChange={handleChange}
            required
          />


          <select 
            name="region"
            value={formData.region}
            onChange={handleChange}
            required
          >
            <option value="north">North</option>
            <option value="middle">Middle</option>
            <option value="south">South</option>
            </select>
          <input 
            type="text"
            name="area"
            placeholder="Area"
            value={formData.area}
            onChange={handleChange}
            required
         />
         <input 
            type="text"
            name="institue"
            placeholder="Institue"
            value={formData.institue}
            onChange={handleChange}
            required
         />
         <input 
            type="text"
            name="residence"
            placeholder="Residence"
            value={formData.residence}
            onChange={handleChange}
            required
         />
         <input 
            type="text"
            name="profession"
            placeholder="Profession"
            value={formData.profession}
            onChange={handleChange}
            required
        />
        <input 
            type="text"
            name="dateOfBirth"
            placeholder="Date Of Birth"
            value={formData.dateOfBirth}
            onChange={handleChange}
            required
        />
       <select
            name="gender"
            value={formData.gender}
            onChange={handleChange}
            required
        >   
        <option value="male">Male</option>
        <option value="female">Female</option>
        </select>
        <select
            name="educationLevel"
            value={formData.educationLevel}
            onChange={handleChange}
            required
        >   
        <option value="">Select Education Level</option>
        <option value="middle_school">Middle School</option>
        <option value="high_school">High School</option>
        <option value="diploma">Diploma</option>
        <option value="bachelor">Bachelor</option>
        <option value="master">Master</option>
        </select>
        <select
            name="howDidYouHearAboutUs"
            value={formData.howDidYouHearAboutUs}
            onChange={handleChange}
            required
        >   
        <option value="">How Did You Hear About Us?</option>
        <option value="social_media">Social Media</option>
        <option value="relative">Relative</option>
        <option value="google_search">Google Search</option>
        </select>


          <div style={{ display: "flex", gap: "10px" }}>
            <button type="submit" disabled={loading}>
              {loading ? "Saving..." : "Save"}
            </button>
            <button type="button" onClick={onClose}>
              Cancel
            </button>
          </div>
        </form>
      </div>
    </div>
  );
}

// Simple modal styling
const modalOverlayStyle = {
  position: "fixed",
  top: 0,
  left: 0,
  width: "100%",
  height: "100%",
  backgroundColor: "rgba(0,0,0,0.5)",
  display: "flex",
  alignItems: "center",
  justifyContent: "center",
  zIndex: 1000
};

const modalContentStyle = {
  backgroundColor: "#fff",
  padding: "20px",
  borderRadius: "8px",
  width: "400px",
  maxHeight: "90%",
  overflowY: "auto",
  boxShadow: "0 4px 6px rgba(0,0,0,0.1)"
};
